CREATE TABLE IF NOT EXISTS [attendees] (
[id] INTEGER PRIMARY KEY NOT NULL,
[name] VARCHAR NULL,
[phone] VARCHAR NULL,
[address] VARCHAR NULL,
[city] VARCHAR NULL,
[state] VARCHAR NULL,
[country] VARCHAR NULL,
[postalZip] INT NULL,
[email] VARCHAR NULL,
[Company] VARCHAR NULL,
[companyFunded] FLOAT NULL,
[userID] VARCHAR NULL,
[team] INT NULL,
[paid] BOOL NULL,
[date] VARCHAR NULL,
[title] VARCHAR NULL
);

